sys_variable_value.value:
(function execute(inputs, outputs) {
    
    const api = new x_neyu_google_nyu.GoogleSheetsAPI();
    const response = api.appendRow(
        inputs.spreadsheet,
        inputs.sheet,
        inputs.payload,
        inputs.auth_profile_type,
        inputs.auth_profile,
        inputs.value_input_option,
        inputs.insert_data_option,
        inputs.include_values_in_response
    );

    outputs.response = JSON.stringify(response);

})(inputs, outputs);

