sys_variable_value.value:
(function execute(inputs, outputs) {
    
    try {
        var response = JSON.parse(inputs.response_body);
        if (!response.error && response.status == "200") {
            outputs.status = "Success";
            outputs.result = JSON.stringify(response.result);
        } else {
            outputs.status = "Error";
            if (response['result']['error']['message'].includes("Unable to parse range")) {
                outputs.error_message = "Specified sheet not found";
            } else {
                outputs.error_message = response.errorMessage;
            }
        }
    } catch (ex) {
        outputs.status = "Error";
        outputs.error_message = "There was an error parsing the response: " + ex.getMessage();
    }

})(inputs, outputs);

