sys_variable_value.value:
(function execute(inputs, outputs) {
    
    if (!inputs.spreadsheet || inputs.spreadsheet.trim() == "") {
        throw "Provide Spreadsheet ID";
    }
    if (!inputs.sheet || inputs.sheet.trim() == "") {
        throw "Provide Sheet";
    }
    outputs.spreadsheet = inputs.spreadsheet.trim();
    outputs.sheet = encodeURIComponent(inputs.sheet.trim());
    outputs.auth_profile_type = (new x_neyu_google_nyu.GoogleSheetsAPI()).getProfileType(inputs.auth_profile);
    outputs.auth_profile = inputs.auth_profile;
    try {
        // Calling Get Cell Values to get the headers of the sheet
        var action_inputs = {};

        action_inputs["authentication_profile"] = inputs.auth_profile;
        action_inputs["spreadsheet_id"] = outputs.spreadsheet;
        action_inputs["sheet"] = outputs.sheet;
        action_inputs["range"] = "A1:Z1";

        var action_outputs = sn_fd.FlowAPI.executeAction(
            "x_neyu_google_nyu.get_cell_values", action_inputs
        );

        // gs.info("action_outputs: " + JSON.stringify(action_outputs));

        var headers = action_outputs['values'];
        var status = action_outputs['status'];
        var error_message = action_outputs['error_message'];
        if (!gs.nil(error_message)) {
            throw error_message;
        }

        if (status == "Success") {
            var values = inputs.values.split('^');
            // gs.info("values: " + JSON.stringify(values));
            var payload = {
                values: [
                    []
                ]
            };
            var values_dict = {};
            for (var i = 0; i < values.length; i++) {
                var key_value = values[i].split('=');
                values_dict[key_value[0]] = key_value[1];
            }
            // gs.info("values_dict: " + JSON.stringify(values_dict));
            var header_values = JSON.parse(headers[0]);
            // gs.info("header_values: " + JSON.stringify(header_values));
            for (var i = 0; i < header_values.length && i < values.length; i++) {
                payload.values[0].push(values_dict[header_values[i]]);
            }
            // gs.info("Payload: " + JSON.stringify(payload));
            outputs.payload = JSON.stringify(payload);
        }
    } catch (ex) {
        var message = ex.getMessage();
        gs.error(message);
    }

})(inputs, outputs);

